import React from 'react'
import _ from 'lodash'
const PostRender = ({ post, link, likes, update }) => {
  const { results } = post
  console.log(update)
  const values = {}
  console.log(results)
  const indi = () => {
    return _.map(results, post => {
      return (
        <div key={post.pk}>
          <li className='list-group-item rounded-0' onClick={() => { link.push(`/posts/${post.pk}`) }} key={post.pk}>
            {post.name}
            <span className='badge badge-secondary float-right'>Like</span>
            <span className='badge badge-secondary ml-3' onClick={() => {
              link.push(`/posts/${post.pk}`)
            }}>{ likes }</span>
          </li>
        </div>
      )
    })
  }
  console.log(indi())
  return (
    <div className='row justify-content-center'>
      <ul className='col-md-8 list-group text-center px-3'>{indi()}</ul>
    </div>
  )
}

// is localStorage in react

export default PostRender
